	add("linda", "{\"term\":\"linda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\"], \"text\":\"Latinized short form of Proto-germanic compound names ending in {{m|de|-lind}}, {{m|de|-linde||tender, soft}} (English {{m|en|-inda}}), such as {{m|de|Sieglinde}} and {{m|de|Dietlinde}}, and earlier names such as Old high german (ca. 750-1050) {{m|goh|Irmilinda}} and Old Low Franconian \u0027frithelind\u0027 from Proto-germanic {{m|gem-pro|*linþiz||gentle, mild}}, whence also Old English {{m|ang|līþe||gentle, mild, pliable, limber}} (English {{m|en|lithe}}). Later associated with Spanish {{m|es|linda||beautiful}}. The name became known through 19th century literature and the opera \u0027Linda di Chamounix\u0027 (1842). More at {{l|en|lithe}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1752\u0027\u0027 Countess D\u0027Aulnoi, Thomas Parnell: \u0027The Court of Queen Mab. Tales of Fairies\u0027. London,M.Cooper, MDCCLII.page 328\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027Orange-Tree\u0027 stood in a Wood which belong\u0027d to a Princess, who liv\u0027d in a magnificent Palace not far off, and us\u0027d to walk there. This Princess was young, beautiful and witty, and her Name \u0027\u0027\u0027Linda\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027 Jack Lawrence: \u0027Linda\u0027 ( a popular song\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When I go to sleep / I never count sheep / I count all the charms about \u0027\u0027Linda\", \"priority\":4}]}, \"synonyms\":{}}");

