	add("linker", "{\"term\":\"linker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|link}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which links\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a computer program that takes one or more objects generated by compilers and assembles them into a single executable program\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short oligonucleotide containing a recognition sequence for a restriction enzyme, used to blunt the ends of sticky DNA segments\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A word that serves to link other elements\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A linked bond, one for which the principal is indexed to inflation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("linnet", "{\"term\":\"linnet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027linette\u0027 from \u0027lin\u0027 (flax) from the bird\u0027s fondness for the seeds of flax, the source of linen.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small passerine bird, in the finch family Fringillidae, native to Europe, western Asia, and north Africa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A house finch\", \"priority\":2}]}, \"synonyms\":{}}");

	add("linoleum", "{\"term\":\"linoleum\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Coined c. 1864 by inventor {{w|Frederick Walton}}, from Latin \u0027linum\u0027 (flax) + \u0027oleum\u0027 (oil) Used as a trade name but never registered as a trademark, it was the first product whose name was ruled to be w:Genericized trademark|genericized.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inexpensive waterproof covering used especially for floors, made from solidified linseed oil over a burlap or canvas backing, or from its modern replacement, polyvinyl chloride\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, w:M. Barnard M. Barnard Eldershaw, \u0027w:A House is A House Is Built\u0027, Chapter VII, Section v\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The house seemed unfamiliar in the dark stormy light; the red and purple glass of the front door made livid bruises on the \u0027\u0027linoleum\u0027\u0027; the green chenille curtain was like a veil of seaweed\", \"priority\":3}]}, \"synonyms\":{}}");

	add("linseed", "{\"term\":\"linseed\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027līnsǣd\u0027 (lang\u003dang) from \u0027līn\u0027 (lang\u003dang) + \u0027sǣd\u0027 (seed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The seed of the flax plant, which yields linseed oi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Ancients widely regarded \u0027\u0027linseed\u0027\u0027 as a source of medical treatments\", \"priority\":2}]}, \"synonyms\":{}}");

	add("lintel", "{\"term\":\"lintel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lyntel\u0027 () from Old french (842-ca. 1400) \u0027lintel\u0027 () from Latin \u0027līmināris\u0027 from {{m|la|līmen||threshold (bottommost part of a doorframe)}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horizontal structural beam spanning an opening, such as between the uprights of a door or a window, and which supports the wall above\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, w:W. Somerset W.S. Maugham, \u0026quot;s:Of Human Bondage/Chapter Of Human Bondage\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Athelny had told him that he lived in a house built by Inigo Jones; he had raved, as he raved over everything, over the balustrade of old oak; and when he came down to open the door for Philip he made him at once admire the elegant carving of the \u0027\u0027lintel\", \"priority\":3}]}, \"synonyms\":{}}");

	add("linter", "{\"term\":\"linter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The short fibres that cling to cottonseeds after the first ginning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("linus", "{\"term\":\"linus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the name of the second pope, Latin \u0027linus\u0027 Ancient greek (to 1453) \u0027λῖνος\u0027 of uncertain meaning.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2 Timothy 4: 21\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Do thy diligence to come before winter. Eubulus greeteth thee, and Pudens, and \u0027\u0027Linus\u0027\u0027, and Claudia, and all the brethren\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 , \u0027Left Neglected\u0027, Simon and Schuster, ISBN 1439164630, pages 8-9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Yes, my children are Peanuts characters. Charlie, seven, and Lucy, five, were given their names without thought or reference to the comic strip. Charlie was named after Bob\u0027s grandfather and we both just liked the name Lucy. Then, when I was unexpectedly expecting again\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;I\u0027d go with Schroeder,\u0026quot; a work colleague offered. \u0026quot;No, definitely \u0027\u0027Linus\u0027\u0027. Or Woodstock,\u0026quot; said another. It was only then that I realized the pattern we\u0027d started with our first two kids. And I liked the name \u0027\u0027Linus\", \"priority\":5}]}, \"synonyms\":{}}");

